description:
Ghost Whisperer:  The Other Side explores the spirit world from the perspective of an earthbound spirit named Zach, who as he searches for answers about his death meets ghosts that teach him how to intersect with the land of the living. Mark Halpa stars as Zach, with Matthew Alan as Danny, the friend Zach holds responsible for his death; Robin Hines as Sarah, Zach's teacher in the spirit world; rapper DNA as Sam, Zach's spirit buddy; Graham McTavish as the Shadow Spirit, a ghost from the Dark Side; and fashion model Taylor as Zach's girlfriend Katie. Zach makes an appearance in the second season finale of Ghost Whisperer.  
